import './App.css';
import axios from 'axios'
import { useState } from 'react';
import { Button, Card, CardGroup, Col, Container, Row } from 'react-bootstrap'
import { RiMoneyDollarCircleLine } from 'react-icons/ri';

function App() {

  const [properties, setProperties] = useState([])

  const handleSubmit = async (event) => {
    event.preventDefault()
    await axios.get('http://localhost:8000/huurwoningen/')
      .then(response => {
        setProperties(response.data)
        console.log(response.data)
      })
      .catch(error => {
        console.log('not worked')
        setProperties(['not good'])
      })
  }

  const currentTime = new Date()

  return (
    <Container>
      <h1 style={{textAlign: 'center'}}>Huurwoningen's listings </h1>
      <div className="d-flex align-items-center justify-content-center">
        <Button onClick={handleSubmit} variant="dark">Press me!</Button>        
      </div>
      <Row className="g-4 pt-3">
        <CardGroup>
          {properties.map((element, index) => {
            return(
              <Col lg={3} md={6} key={index} className="pb-3 ps-1 d-flex align-items-stretch w-100">
                <Card>
                  <div className="image-wrapper">
                    <div id='background-image' className="backgroundStyle" style={{backgroundImage: `url(${element[3]})`}} />
                  </div>
                  <Card.Body>
                    <Card.Title>
                      <a href={element[1]}>
                        {element[0]}
                      </a>
                    </Card.Title>
                    <Card.Text>
                      {/* Price */}
                      <p>
                        {element[2]}
                      </p>
                      <Row>
                        <Col md={4}>
                          {/* Surface area */}
                          <p>
                            {element[4]}
                          </p>
                        </Col>
                        <Col md={4}>
                          {/* Number of rooms */}
                          <p>
                            {element[5]}
                          </p>
                        </Col>
                        <Col md={4}>
                          {/* Furniture status */}
                          <p>
                            {element[6] === "Gemeubileerd" ? "Furnished" : element[6] === "Gestoffeerd" ? "Upholstered" : element[6]}
                          </p>
                        </Col>
                      </Row>
                    </Card.Text>
                  </Card.Body>
                  <Card.Footer>
                    <small className="text-muted">Last updated: {currentTime.toLocaleDateString()} at {currentTime.getHours()}:{currentTime.getMinutes()}</small>
                  </Card.Footer>
                </Card>
              </Col>
            )
          })}
        </CardGroup>
      </Row>
    </Container>
  );
}

export default App;
